package com.servinglynk.hmis.warehouse.core.model;import com.fasterxml.jackson.annotation.JsonProperty;import com.fasterxml.jackson.annotation.JsonRootName;@JsonRootName("developerCompanyStatus")public class DeveloperCompanyStatus extends ClientModel{	private String status;	private String comment;		@JsonProperty(value="developerCompany")	private DeveloperCompany developerCompany;		public String getStatus() {		return status;	}	public void setStatus(String status) {		this.status = status;	}	public String getComment() {		return comment;	}	public void setComment(String comment) {		this.comment = comment;	}	public DeveloperCompany getDeveloperCompany() {		return developerCompany;	}	public void setDeveloperCompany(DeveloperCompany developerCompany) {		this.developerCompany = developerCompany;	}	}